【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ よく使うワット数＆時間の「ワンタッチメニュー」搭載。<br /><br />★ とにかく少ない操作で使えるシンプルさを追求しました。<br /><br />★ 出力を4段階に変えられ、レトルト食品の温め表記時間に合わせるのに便利です。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 定格電圧：100V 50Hz／60Hz<br />* 定格消費電力：1050W/50Hz 1350W/60Hz<br />* レンジ出力：700W/600W/500W/解凍<br />* タイマー：0-15分(解凍30分)<br />* 容量：20L<br />* 電源コード長さ：1.4m<br />* 本体カラー：ホワイト<br />* 付属品：ガラス皿・回転受け台・取説<br />* 寸法：<br />庫内 W315 x D329 x H180mm<br />ターンテーブル 245mm<br />本体 W452 x D340 x H262mm､11.5kg<br />梱包 W505 x D434 x H310mm､13.3kg<br />* 主要材質：本体　鋼板、扉　強化ガラス、操作パネル、取手 ABS</p></div><!-- 商品仕様 ここまで --><style>

